import React from 'react'
import { useNavigate } from 'react-router-dom'

const ItemRow = ({ item }) => {
	const navigate = useNavigate();

	return (
		<tr>
			<td>{item.name}</td>
			<td>
				<button onClick={() => navigate(`${item.id}`)}>Show detail</button>
			</td>
		</tr>
	)
}

export default ItemRow
